import React from "react";
import { Container, Navbar } from "./Styles";
import "./Nav.css";
import logo from "../assets/logodefm.svg";

const Nav = () => {
  return (
    <header>
      <Container>
        <Navbar>
          <img src={logo} alt="" style={{width: "110px;"}} />
          <nav>
            <ul className="nav_items">
              <li>
                <a href="/">Repositories</a>
              </li>
              <li>
                <a href="/">Design</a>
              </li>
            </ul>
          </nav>
        </Navbar>
      </Container>
    </header>
  );
};

export default Nav;
